import { useState } from "react"

export const FormularioEstudiante = ({ agregar }) => {
    const [id, setId] = useState("");
    const [nombre, setNombre] = useState("");
    const [semestre, setSemestre] = useState("");
    const [facultad, setFacultad] = useState("");
    const [genero, setGenero] = useState("");

    const guardarEstudiante = (event) => {
        if (nombre.length < 3) {
            alert("El nombre debe tener minimo 3 letras")
            return;
        }

        let estudiante = {
            id: id,
            nombre: nombre,
            semestre: semestre,
            facultad: facultad,
            genero: genero
        }

        agregar(estudiante)
        setId("");
        setNombre("");
        setSemestre("");
        setFacultad("");
        setGenero("");
    }

    function habilitarButton() {
        var semes = document.getElementById("semes").value
        var fac = document.getElementById("facultad").value
        var gen = document.getElementById("genero").value
        if (semes == "") {
            document.getElementById("registrar").disabled = true;
        } else if (fac == "") {
            document.getElementById("registrar").disabled = true;
        } else if (gen == "") {
            document.getElementById("registrar").disabled = true;
        } else {
            document.getElementById("registrar").disabled = false;
        }
    }

    return (
        <>
            <script>

            </script>
            <h1 className="text-center text-light " style={{ fontSize: "100px", backgroundColor: "#AD9978" }}>Biblioteca</h1>
            <div id="miDiv">
                <form onSubmit={guardarEstudiante} style={{ backgroundColor: "#AD9978" }}>
                    <div className="form-group input-group">
                        <label class="input-group-text" for="inputGroupSelect01">Titulo</label>
                        <input type="text" className="form-control" id="nombre" placeholder="Nombre" value={nombre} onChange={(event) => setNombre(event.target.value)} />
                    </div>
                    <br />
                    <div className="form-group input-group">
                        <label class="input-group-text" for="inputGroupSelect01">Autor</label>
                        <input type="text" className="form-control" id="nombre" placeholder="Nombre" value={nombre} onChange={(event) => setNombre(event.target.value)} />
                    </div>
                    <br />
                    <div className="form-group input-group">
                        <label class="input-group-text" for="inputGroupSelect01">Genero</label>
                        <br></br>
                        <select id="semes" value={semestre} onChange={(event) => { setSemestre(event.target.value); habilitarButton(); }}>
                            <option value="">--Seleccione el semestre--</option>
                            <option value="1">Ficcion</option>
                            <option value="2">Novela</option>
                            <option value="3">Suspenso</option>
                            <option value="4">Fantasia</option>
                            <option value="5">Romance</option>
                            <option value="6">Historia</option>

                        </select>
                    </div>
                    <br />

                    <button id="registrar" type="submit" className="btn btn-primary" disabled>Registrar</button>
                </form>
            </div>
            <style>
                
                {`
                 ::-webkit-scrollbar {
            width: 10px;
          }

          ::-webkit-scrollbar-track {
            background: #f1f1f1;
          }

          ::-webkit-scrollbar-thumb {
            background: #6fc1ff;
          }
          #miDiv {
            position: absolute;
            left: 0;
            width: 60%;
            height: 10%;
          }

        `}
        
            </style>
        </>
    )
}
